import {StyleSheet, Text, View, TouchableOpacity, Image} from "react-native";

const Login = () => {
  return (
    <View style={styles.container}>


        <View style={styles.infoContainer}>
          <Text style={styles.titleText}>Set Your Run</Text>
        </View>
        <View style={styles.buttonBox}>
            <View style={styles.button}>
                  <TouchableOpacity>
                    <Text style={styles.defaultText}>Login</Text>
                  </TouchableOpacity>
            </View>
        </View>
        <View style={styles.suggestionGoalContainer}>
          <View style={styles.suggestedGoal}>
              <View style={styles.suggestionInfo}>
                <Image style={styles.runner} source={require("./assets/runner.png")}/>
                <View>
                  <Text style={styles.suggestionTitleText}>Need Suggested Goals?</Text>
                  <Text>Based on your previous usage, 
                    {"\n"} 
                    we can give you suggested goals on time, pace and distance.</Text>
                </View>

              </View>

              {/* <Text style={styles.suggestionTitleText}>Email</Text>
              <TextInput style={styles.inputBox}></TextInput>

              <TextInput secureTextEntry={true} style={styles.inputBox}></TextInput>
              <Text style={styles.suggestionTitleText}>Incorrect credentials, please try again.</Text> */}
          </View> 
        </View>


    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#F5F5F5",
    fontFamily: "sf compact text",
  },

  infoContainer: {
    paddingLeft: 30,
    paddingTop: 60    
  },

  runner: {
    marginLeft: 10,
    marginTop: 10,
    width: 40,
    height: 40
  },  

  suggestionGoalContainer: {
    width: "100%",
    alignItems: "center"
  },

  suggestionInfo: {
    flexDirection:"row"
  },

  suggestedGoal: {
    marginTop: 30,
    borderRadius: 10,
    borderWidth: 1,
    borderColor: "#fff",
    width: "90%",
    height: 100,
    backgroundColor: "#fff"
  },  

  titleText: {
    fontSize: 30,
    fontWeight: "700",
    letterSpacing: 1,
  },

  suggestionTitleText: {
    color: "#000",
    fontSize: 15,
    fontWeight: 600,
    marginTop: 5,
    marginLeft: 10,
  },

  defaultText: {
    color: "#fff",
    fontSize: 17,
  },

  inputBox: {
    marginTop: 5,
    paddingLeft: 5,
    paddingRight: 5,
    paddingBottom: 5,
    backgroundColor: "#F5F5F5",
    width: "90%",
    height: 50,
    borderRadius: 10,
    fontSize: 20
  },

  buttonBox: {
    width: "100%",
    alignItems: "center",
    position: "absolute",
    bottom: 150,
  },

  button: {
    marginTop: 7,
    width: 250,
    height: 50,
    borderRadius: 7,
    backgroundColor: "#0263FF",
    color: "white",
    alignItems: "center",
    justifyContent: "center"
  },
});

export default Login;
